import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import Footer from './components/Footer';
import NavigationBar from './components/NavigationBar';
import Index from './pages/home/Index';
import Offers from './pages/offers/Offers';
import About from './pages/about/About';
import Facility from './pages/facilities/Facility';
import Gallery from './pages/gallery/Gallery';
import ServiceType from './pages/serviceType/ServiceType';
import Reservation from './pages/reservation/Reservation';
import FoodMenu from './pages/foodMenu/FoodMenu';
import Signup from './pages/signup/Signup';
import Login from './pages/login/Login';
import Burgers from './pages/foodMenu/foodItems/Burgers';



function App() {
  return (
    <Router>
      <div>
        <NavigationBar/>
        <Routes>
          <Route path='/' element={<Index />} />
          <Route path="/about" element={<About />} />
          <Route path="/facilities" element={<Facility />} />
          <Route path="/gallery" element={<Gallery />} />
          <Route path="/offers" element={<Offers />} />
          <Route path="/serviceTypes" element={<ServiceType />} />
          <Route path="/reservation" element={<Reservation />} />
          <Route path='/foodMenu' element={<FoodMenu/>} />
          <Route path='/signup' element={<Signup />} />
          <Route path='/login' element={<Login />} />

          <Route path='/burgers' element={<Burgers />} />
          <Route path='/nuggets' element={<Burgers />} />
          <Route path='/salads' element={<Burgers />} />
          <Route path='/fries' element={<Burgers />} />
          <Route path='/muffins' element={<Burgers />} />
          <Route path='/biscuits' element={<Burgers />} />
          <Route path='/frosty' element={<Burgers />} />
          <Route path='/coffee' element={<Burgers />} />
          <Route path='/burgers' element={<Burgers />} />
          <Route path='/burgers' element={<Burgers />} />
          <Route path='/burgers' element={<Burgers />} />
          <Route path='/burgers' element={<Burgers />} />
        </Routes>
        <Footer/>
      </div>
    </Router>

  );
}

export default App;
